import React from "react";

export default function Businesses() {
  return (
    <div>
      <h1>Freshbox For Corporate</h1>
      <p>
        Freshbox is a logistics company that sources and delivers local farm
        fresh fruits, vegetables and healthy snacks to your office.
      </p>

      <p>
        If you run a company, an office or a coworking space, we will be happy
        to provide your workplace with our amazing products.
        <br />
        <br />
        To find out how we can help your company, please contact{" "}
        <a href="tel:+1-925-5884945">sales</a>.
      </p>
    </div>
  );
}
